import { booksByGenre } from "./Api";

export function GetBookByID(bookID) {
  console.log('In the id checker')
  for (const [key, value] of Object.entries(booksByGenre)) {
    console.log(key + ' ' + value)
    if (value.id === bookID) return value
  }
  return null;
}
